import { Paper, Typography } from '@mui/material'
import { Box } from '@mui/system'
import React from 'react'

export const Destinations = () => {
  return (
    <Box sx={{
        display: "flex",
        justifyContent: "center",
        height: "100vh"
    }}>
         <Box
      sx={{
        display: 'flex',
        flexWrap: 'wrap',
        '& > :not(style)': {
          m: 1,
          width: 128,
          height: 128,
        },
      }}
    >
      <Paper elevation={0} />
      <Paper />
      <Paper elevation={3} />
    </Box>
    </Box>
  )
}
